INSERT INTO `LABORATORIO` VALUES (4,'LabPAI','O Laboratório de Processamento e Análise de Imagens - LabPAI - foi criado em agosto de 2004 com apoio do CNPq na Universidade Federal do Maranhão, com o objetivo de desenvolver, implantar e manter software de processamento e análise de imagens para aplicações técnico-científicas. O LabPAI é um dos laboratórios do Departamento de Engenharia de Eletricidade, e seus projetos são desenvolvidos em cooperação com o Departamento de Informática – DEINF/UFMA, Departamento de Matemática – DEMAT/UFMA, o Programa de Pós-graduação em Saúde da Mulher, Adolescente e Criança da Universidade Federal do Maranhão, o Instituto de Matemática Pura e Aplicada- IMPA, a Pontifícia Universidade Católica do Rio de Janeiro – PUC-Rio, e a Universidade de do Estado do Rio de Janeiro – UERJ.\n\nO LabPAI é coordenado pelo Prof. Aristófanes Corrêa Silva, do Departamento de Engenharia de Eletricidade, que interage com uma equipe de ótimos consultores, pesquisadores, engenheiros, analistas e alunos da UFMA e de outras Instituições. A pesquisa aqui desenvolvida faz parte das atividades acadêmicas do Departamento de Engenharia de Eletricidade e do Departamento de Informática da UFMA. Em decorrência de suas linhas de pesquisa, o Laboratório tem uma boa produção de trabalhos publicados, forma alunos de iniciação científica e de mestres, e interage com grupos de pesquisas no país.\n\nAtualmente, a instalação do Laboratório ocupa uma área de 40m2 e possui a seguinte infra-estrutura: 10 (dez) Estações de trabalho PC, 1 (uma) Impressoras laser, 1 (um) Datashow Sony, 1 (uma) Câmera fotográfica digital Sony de 7.2 MPixels, 2 (duas) webcams e um acervo com aproximadamente 10 livros.','32323232','data:image/png;base64,');
/*!40000 ALTER TABLE `LABORATORIO` ENABLE KEYS */;
UNLOCK TABLES;

