INSERT INTO `NOTICIA` VALUES (18,'Acesso de estudantes à UNREAL game ENGINE','<div align=\"justify\">Students can receive Unreal Engine 4 for free! Through Epic Games’ collaboration with GitHub, students can now visit    <br><a href=\"https://education.github.com/pack\" target=\"_blank\" rel=\"nofollow\">https://education.github.com/pack</a> to sign up for and receive redemption codes for UE4. <span class=\"text_exposed_show\"></span><br><span class=\"text_exposed_show\"> Students can now sign up for free simply by applying for one through GitHub’s Student Developer Pack.</span></div>                     <div align=\"justify\">Students can receive Unreal Engine 4 for free! Through Epic Games’ collaboration with GitHub, students can now visit    <br><a href=\"https://education.github.com/pack\" target=\"_blank\" rel=\"nofollow\">https://education.github.com/pack</a> to sign up for and receive redemption codes for UE4. <span class=\"text_exposed_show\"></span><br><span class=\"text_exposed_show\"> Students can now sign up for free simply by applying for one through GitHub’s Student Developer Pack.</span></div>                     ','data:image/png;base64,','2015-01-20 16:32:29'),(21,'Universo IFMA Programação ','<p align=\"justify\"> Desafios de ideias, concursos de games e mostra de produtos e \nprocessos tecnológicos. Esse é o Universo IF.  O Universo IF acontece \nentre os dias 16 e 19 de novembro de 2014, em São Luis (MA).</p><div align=\"justify\"> <a href=\"http://media.wix.com/ugd/944f83_c79ffed65d014b9c96690a07dfd98757.pdf\">Programação <span class=\"text_exposed_show\"></span></a><br><span class=\"text_exposed_show\"></span></div>','data:image/png;base64,','2015-01-20 15:12:25'),(22,'Pequenas Corrupções – Diga não!','<p> A campanha alerta para o fato de que atitudes cotidianas e que \nmuitas vezes passam despercebidas, na verdade, podem ser desvirtuamentos\n éticos que devem ser combatidos. Hábitos cotidianos de um povo podem \nrefletir como são encaradas os casos de corrupção com dinheiro público \nno país.</p><p align=\"justify\"> Saiba mais sobre a campanha: <a href=\"http://www.cgu.gov.br/diganao\" target=\"_blank\" rel=\"nofollow\">http://www.cgu.gov.br/diganao</a></p>','data:image/png;base64,','2015-01-20 15:24:14'),(24,'Concurso UERJ','<p>Concurso para uma vaga no departamento de<br> informática e ciência da computação da Uerj destinada à área de computação<br> gráfica - especialidades visão computacional, análise e processamento de<br> imagem.</p><div class=\"text_exposed_show\"><p> Em nossa universidade, o vencimento base no regime de 40h é de R$ 5.497,00,<br> mas caso opte por ingressar no regime trabalho de dedicação exclusiva o<br> salário bruto vai a  R$ 9.070,00. Além disso, professores com bom nível de<br> produção podem concorrer a uma bolsa de R$ 4.000,00 mensais sem incidência<br> de imposto através do programa prociência.</p><p> As inscrições serão realizadas no período de *05/01/2015 a 16/01/2015 e de<br> 21/01/2015 a 11/02/2015*, no Instituto de Matemática e Estatística da UERJ,<br> situado na Rua São Francisco Xavier, nº 524, pavilhão João Lyra Filho, 6º<br> andar, bloco B, sala 6019, Maracanã, cidade do Rio de Janeiro, telefones<br> (21) 2334-0144 / 2334-0344, das 10 horas às 16 horas.</p><p> Maiores informações podem ser obtidas no edital:<br> <a href=\"http://srh.uerj.br/docente/Arquivos/concurso1113/ED_ADJ_COMPUTA%C3%87%C3%83O%20GR%C3%81FICA.doc\" target=\"_blank\" rel=\"nofollow\">http://srh.uerj.br/…/ED_ADJ_COMPUTA%C3%87%C3%83O%20GR%C3%81…</a></p><p> Em caso de dúvida, fique a vontade para me contactar através dos e-mails<br> guimota@ime.uerj.br e guimota@gmail.com</p></div>','data:image/svg+xml;base64,','2015-01-20 15:26:46');
/*!40000 ALTER TABLE `NOTICIA` ENABLE KEYS */;
UNLOCK TABLES;

